export const filters = {
    NUMBERS:    /\D/gim,
    LETTERS:    /[^a-z]/gim,
    CHARACTERS: /\W/gim,
    NONE:       null,
};


export const modes = {
    AUTO:    'auto',
    NORMAL:  'normal',
    REVERSE: 'reverse'
}
